  false,\n\t\"url\": null,\n\t\"notes\": \"This entry contains the results from the
  Outer Continental Shelf Studyn(OCS) benchmark study in the North Atlantic which
  ran May 5 to Septembern2, 1977 from the R/V GILLISS. These data were submitted by
  EnergynResources Co.,Inc. in fulfillment of BLM contract # AA550-CT6-51. Thisndata
  contains eleven files with different file types and so differentnreference numbers
  have been assigned. The following is a description ofnthe files and a listing of
  the reference numbers: file 1 labellednL01000, L130 contains nutrients, sal, temp
  and do data; file 2 labellednL00984, L513 contains %silt, %clay, %grain size, %carbon
  and %nitrogennin sediments; file 3,4 labelled L00985, L521 contains taxonomic code,ncounts
  and egg/larvae; file 5 labelled L00986, L134 contains metals innzooplankton, water,
  sediment and macrobenthos; file 6 labelled L00987,nL131 contains lipids,hydrocarbons
  in water, zooplankton, macrobenthos,nsediment and surface film and; file 7,8,9 labelled
  L00988, L504 containsnmacrobenthic taxonomic codes and counts.\",\n\t\"owner_org\":
